    def make_fips_df(self):
        df = pd.DataFrame.from_dict(self.state_fips_dict)
        return df

    def make_county_fips_df(self):
        df = pd.DataFrame.from_dict(self.county_fips_dict)
        return df

    def get_fips_list(self):
        return self.state_df['fips'].to_list()

    def get_state_fips_from_abb(self, abb):
        key = [key for key, val in self.state_fips_dict['stusab'].items() if str(val).lower() == str(abb).lower()]
        return self.state_df['state_fips'].iloc[key].values[0]

    def get_state_name_from_abb(self, abb):
        key = [key for key, val in self.state_fips_dict['stusab'].items() if str(val).lower() == str(abb).lower()]
        return self.state_df['state_name'].iloc[key].values[0]

    def get_state_fips_from_state_name(self, state_name):
        key = [key for key, val in self.state_fips_dict['state_name'].items() if
               str(val).lower() == str(state_name).lower()]
        return self.state_df['state_fips'].iloc[key].values[0]

